import React, { Component } from "react";
import { Table, Tag, Space } from 'antd';

const columns = [
    {
        title: 'Price',
        dataIndex: 'price',
        key: 'price',
    },
];

const dataSource = [
    {
        "zpid": "2079035938",
        "id": "2079035938",
        "hasImage": true,
        "imgSrc": "https://photos.zillowstatic.com/p_e/ISjbwb93b1hxkp1000000000.jpg",
        "detailUrl": "https://www.zillow.com/homedetails/(undisclosed-Address)-Spring-Grove-IL-60081/2079035938_zpid/",
        "statusType": "FOR_SALE",
        "statusText": "House for sale",
        "price": "$449,999"
    }];


class Zillow extends Component {
    state = {
        resultCount: 0
    };

    searchZillow = async (event) => {
        event.preventDefault();
        let response = await fetch('/zillow');
        let body = await response.json();
        this.setState({ resultCount: body.searchList.totalResultCount });
    }

    render() {
        return (
            <div class="tab">
                <button onClick={(event) => this.searchZillow(event)}>Search</button>
                <h2>Properties Found {this.state.resultCount}</h2>
                <Table dataSource={dataSource.searchResults.listResults} columns={columns} />
            </div>
        );
    }
}
export default Zillow
